function Alert(msg) {
    if (typeof WScript != 'undefined')
        WScript.Echo(msg);
    if (typeof process != 'undefined')
        process.stdout.write(msg + "\n");
}

function extractRanges(list) {
    list.sort(function (a, b) {
        if (a === b) return 0;
        if (a < b) return -1;
        if (a > b) return 1;
    });

    var startIndex = 0;
    while (list[startIndex] < 128) {
        startIndex++;
    }

    var entriesCount = 0;
    var rangesCount = 0;
    var singlesCount = 0;
    var ranges = [];

    var start = startIndex;
    var end = 0;
    var inRange = false;

    for (var i = startIndex; i < list.length; i++) {
        if (!inRange) {
            start = i;
            inRange = true;
            entriesCount++;
        }
        if (inRange && (i + 1 == list.length || list[i] !== list[i + 1] - 1)) {
            inRange = false;
            end = i;
            if (list[start] == list[end]) {
                singlesCount++;
            } else {
                rangesCount++;
            }
            ranges.push({ first: list[start], last: list[end] });
        }
    }

    //Alert(" length = " + list.length);
    //Alert(" entriesCount = " + entriesCount);
    //Alert(" rangeCount = " + rangesCount);
    //Alert(" singlesCount = " + singlesCount);

    return ranges;
}

function mergeLists(list, additionalRanges) {
    // do a validation pass
    for (var i = 0; i < additionalRanges.length; i++) {
        var newRange = additionalRanges[i];
        for (var j =0; j < list.length; j++) {
            var range = list[j];
            if (newRange.first > range.last) {
                // have not found it yet
                continue;
            }
            if (newRange.last < range.first) {
                // list is sorted, so we will not be able to find it 
                break;
            }
            throw new Error("Additional range (0x" + newRange.first.toString(16) + ",0x" + newRange.last.toString(16) + ") intersects with existing range (0x" + range.first.toString(16) + ",0x" + range.last.toString(16) + ").");
        }
    }
    
    var newList = list.concat(additionalRanges);
    newList.sort(function (a, b) {
        if (a.first === b.first) throw new Error ("Repeted range");
        if (a.first < b.first) return -1;
        if (a.first > b.first) return 1;
    });
    return newList;
}

function printList(list) {
    var line = "            ";

    for (var i = 0; i < list.length; i++) {
        //Alert((list[start]==list[end] ? " Single " : " Range ") +
        //" \t\t { start: " + String.fromCharCode(list[start]) + ", end: " + String.fromCharCode(list[end]) + "}," +
        //" \t\t { start: " + list[start] + ", end: " + list[end] + "}," +
        //" \t\t { start: 0x" + list[start].toString(16) + ", end: 0x" + list[end].toString(16) + "},");
        //line += " 0x" + list[start].toString(16) + ", 0x" + list[end].toString(16) + ",";
        line += list[i].first.toString() + "," + list[i].last.toString() + ",  ";

        if ((i + 1) == list.length) {
            Alert(line);
            line = "            ";
        }
    }
}


